      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT ( ( NOT ( col2 NOT BETWEEN + - ( + col2 ) - col0 AND + - col2 ) ) );
  - name: tab1

outputs:
  - name: q8773.out
    data: |
      51	14	96
      85	5	59
      91	47	68
